  document.addEventListener('DOMContentLoaded', (event) => {
    // Target the Intercom button by its class
    const intercomButtons = document.querySelectorAll('.intercom-trigger');

    if (window.Intercom) {
      // Add an event listener to each button to trigger the Intercom widget
